import React, { useState } from "react";
import { PDFDocument, PDFForm, PDFTextField, rgb } from "pdf-lib";
import { BtnGreen } from "./BtnGreen";

interface FormData {
  field1: string;
  field2: string;
}

const generatePdfDocument = async (formData: FormData) => {

  const base64 = ''
  const pdfCQA = await PDFDocument.load(base64  );
  const pdfDoc = await PDFDocument.load(base64);
  const title = "Fillable PDF Form";
  const fontSize = 20;

  const page = pdfDoc.addPage();
  const form = pdfDoc.getForm();
  const { width, height } = page.getSize();
  const font = await pdfDoc.embedFont("Helvetica"); const titleWidth = font.widthOfTextAtSize(title, fontSize);
  page.drawText(title, {
    x: width / 2 - titleWidth / 2,
    y: height - 50,
    size: fontSize,
    font,
  });

  const field1 = formData.field1;
  const field1Width = font.widthOfTextAtSize(field1, fontSize);
  const x = width / 2 - field1Width - 20;
  let y = height - 150;
  page.drawText(field1, {
    x,
    y,
    size: fontSize,
    font,
  });



  const field2 = formData.field2;
  const field2Width = font.widthOfTextAtSize(field2, fontSize);
  y = height - 200;
  page.drawText(field2, {
    x,
    y,
    size: fontSize,
    font,
  });
  const infoTextField = form.createTextField("Info");
  infoTextField.addToPage(page, {
    x: x + field1Width + 10,
    y: y - 6,
    width: 200,
    height: 20,
    font,
    textColor: rgb(0, 0, 0),
  });
  return pdfCQA;
};

const PdfDownloadLink = ({ formData }: { formData: FormData }) => {
  const [pdfUrl, setPdfUrl] = useState("");

  const handleDownload = async () => {
    const pdfDoc = await generatePdfDocument(formData);
    const pdfBytes = await pdfDoc.save();
    const pdfUrl = URL.createObjectURL(
      new Blob([pdfBytes], { type: "application/pdf" })
    );
    setPdfUrl(pdfUrl);
  };

  return (
    <>
      <BtnGreen onClick={handleDownload}>Descargar</BtnGreen>
      {pdfUrl && (
        <a
          href={pdfUrl}
          target="_blank"
          rel="noopener noreferrer"
          download="fillable.pdf"
        >
          Open file
        </a>
      )}
    </>
  );
};

export default PdfDownloadLink;
